import React from 'react';
import { useNav } from '../customHooks/useNav';
import './Page.css';

const Tool = () => {
	// useNav takes in a navLinkId and returns a ref
	// this ref is used to register the navLinkId that's
	// currently in view, and apply activeClass styling
	// to the corresponding nav childElement

	const toolRef = useNav('Tool');

	return (
		<section ref={toolRef} id='toolContainer'>
			<img
				src='https://source.unsplash.com/random/600x600/?food,protein'
				alt='unsplash-img'
			/>
			<div>
				<div>
					<p>Use the search tool to help you make smart decisions on food protein.</p>
					<div>
						<h3 class="title">Good Sources of Protein Examples</h3>
						<ul class="examples">
							<li>milk</li>
							<li>fish</li>
							<li>cheese</li>
						</ul>
					</div>
				</div>
				<div>
					<input type="text"/>
					<span></span>
					<button>Click Here To Start Your Search</button>
				</div>
			</div>
		</section>
	);
};

export default Tool;
